name: daytona prebuild delete
synopsis: Delete a prebuild configuration
usage: daytona prebuild delete [PROJECT_CONFIG] [PREBUILD] [flags]
options:
    - name: force
      shorthand: f
      default_value: "false"
      usage: Force delete prebuild
inherited_options:
    - name: help
      default_value: "false"
      usage: help for daytona
    - name: output
      shorthand: o
      usage: Output format. Must be one of (yaml, json)
see_also:
    - daytona prebuild - Manage prebuilds
